import React from "react";
import Avatar from "@material-ui/core/Avatar";
import Button from "@material-ui/core/Button";
import { makeStyles } from "@material-ui/styles";
import AccountCircleIcon from '@material-ui/icons/AccountCircle';
import { useHistory } from "react-router-dom";;

const useStyles = makeStyles((theme) => ({
  avatar: {
    '&:hover':{
      backgroundColor: "grey",
      cursor: "pointer",
    },
  }
}))

function Profile() {
  const classes = useStyles();
  const history = useHistory();

  const initials =  localStorage.getItem("name").match(/(\b\S)?/g).join("").toUpperCase();

  const onClick = () => {
    history.push({
      pathname: "/profile",
      state: {
        initials: initials
      }
    })
  }
  
  return(
    <div style={{marginTop:"10px", marginBottom:"10px", marginLeft:"auto", marginRight:"10px"}}>
      <Avatar className={classes.avatar} src={initials ? null : AccountCircleIcon}>
        <Button onClick={onClick}>
          {initials}
        </Button>
      </Avatar>
    </div>
  );
}

export default Profile;
